import React, {use} from "react";
import axios from "axios";

const obtenerUsuarios = async () => {
  const res = await axios.get("https://jsonplaceholder.typicode.com/users");
  const users = await res.data;
};

const Usuarios = () => {

  const obtenerUsuarios = async () => {
    const res = await axios.get("https://jsonplaceholder.typicode.com/users");
    const users = await res.data;
  };

  return <div></div>;
};

export default Usuarios;
